import StateProvider from '../components/context/StateProider';
import Layout from '../components/layout';

const MyApp = ({ Component, pageProps }) => {
  return (
    <StateProvider>
      <Layout>
        <Component {...pageProps} />
      </Layout>
    </StateProvider>
  );
};

export default MyApp;
